import styled from 'styled-components';

export const Navs = styled.nav`
	background: var(--appleBlack);
	.nav-link {
		font-size: 1rem;
		color: var(--cleanWhite);
		transition:    all 0.8s ease-in-out;
	}
	.nav-link:hover{
	color:         var(--appleBlue);
}
`;
